/* module-key = 'rs.codecentric.label-manager-project:label-manager-project-general-resources', location = '/js/initLabelItPickers.js' */
define('jira/field/label-it-picker-factory', [
    'jira/field/label-it-picker',
    'jira/data/parse-options-from-fieldset',
    'jquery',
    'exports'
], function(
	LabelITPicker,
    parseOptionsFromFieldset,
    $,
    exports
) {
    exports.createPicker = function($fieldset, context) {

        var opts = parseOptionsFromFieldset($fieldset),
            $select = $('#' + opts.id, context),
            issueId = opts.issueId,
            projectId = opts.projectId,
            data = {};
        projectId = AJS.$("#project").val();
        
        if(!projectId) {
        	projectId = AJS.$("input[name=pid]").val();
        }
    	
        if (/customfield_\d/.test(opts.id)) {
            data.customFieldId = parseInt(opts.id.replace('customfield_', ''), 10);
        }
        
        var labelColors; 
        var coloring = false; //need to make it generic based on Settings later on
        if ((issueId!=null) && (issueId!="")) {
            AJS.$.ajax({
                url: contextPath + "/rest/labelit/1.0/labelColor/all" + (issueId ? "?issueId=" + issueId + "&" : "?") + "customFieldId=customfield_" + data.customFieldId,
                dataType: "json",
                async: false,
                success: function (data) {
                    if (data) {
                        coloring = data.coloring;
                        labelColors = data.colors;
                    }
                }
            });
        }
        else //added by hg to get coloring options for project
        {
            AJS.$.ajax({
                url: contextPath + "/rest/labelit/1.0/labelColor/coloring" + (projectId ? "?projectId=" + projectId + "&" : "?") + "customFieldId=customfield_" + data.customFieldId,
                dataType: "json",
                async: false,
                success: function (data) {
                    if (data) {
                        coloring = data.coloring;
                    }
                }
            });
        }
        
        new LabelITPicker({
            element: $select,
            ajaxOptions: {
                url: contextPath + '/rest/labelIt/1.0/items' + (issueId ? '/' + issueId : '/0') + (projectId ? '/' + projectId : '/0') + '/suggest',
                data: data
            },
            issueId: issueId,
            customFieldId: data.customFieldId,
            coloring: coloring,
            labelColors: labelColors
        });
    }

});
(function() {
    var LabelPickerFactory = require('jira/field/label-it-picker-factory');
    var Events = require('jira/util/events');
    var Types = require('jira/util/events/types');
    var Reasons = require('jira/util/events/reasons');
    var $ = require('jquery');
    var FIELDSET_SELECTOR = "fieldset.labelpicker-params";

    function locateFieldset(parent) {
        var $parent = $(parent),
            $fieldset;

        if ($parent.is(FIELDSET_SELECTOR)) {
            $fieldset = $parent;
        } else {
            $fieldset = $parent.find(FIELDSET_SELECTOR);
        }

        return $fieldset;
    }

    function findLabelsFieldsetAndConvertToPicker(context, selector) {
        selector = selector || ".aui-field-label-it-picker";

        $(selector, context).each(function () {
            var $fieldset = locateFieldset(this);

            if ($fieldset.length > 0) {
                LabelPickerFactory.createPicker($fieldset, context);
            }
        });
    }

    Events.bind(Types.NEW_CONTENT_ADDED, function (e, context, reason) {
        if (reason !== Reasons.panelRefreshed) {
        	if(AJS.$("#project-field")){
        		AJS.$("#project-field").change(function () {
        			findLabelsFieldsetAndConvertToPicker(context);
        		});
        	}
            findLabelsFieldsetAndConvertToPicker(context);
        }
    });
})();;
